import React, { useState, useEffect } from "react";
import { Box } from "@mui/material";

const Status = () => {
  const [message, setMessage] = useState(""); // Store the latest message from the backend

  useEffect(() => {
    fetch("http://localhost:3001/latest")
      .then((response) => response.json())
      .then((data) => setMessage(data.message));
  }, []);

  return (
    <>
      <Box
        style={{
          borderTop: "1px solid #f59331",
          width: "80%",
          height: "500px",
          display: "flex",
          justifyContent: "center",
          alignItems: "flex-start",
          marginBottom: "15px",
        }}
      >
        <Box
          style={{
            position: "absolute",
            transform: "translate(-1%, -60%)",
            backgroundColor: "#181818",
            padding: "0 7px",
            zIndex: 1,
            fontSize: "25px",
          }}
        >
          System Controllers
        </Box>
        <div
          style={{
            marginTop: "40px",
            color: "white",
          }}
        >
          {message && <p>{message}</p>}
        </div>
      </Box>
    </>
  );
};

export default Status;
